  01> BUCHANAN, Eric Kemp m on ** ** , 1945 to HILL, Irene
  b 06.10.1920
  b ** ** ****
  Eric b. at Auckland. Address: 26 Cowper Road, Hemel Hempstead, Herts HPI IPE, England.
  01> BUCHANAN, John Howard
  b ** ** 1946
